const initialState = {
    user: [],
    tabs: [],
    loggedIn: false,
    loading: false,
}

export function reducer(state = initialState, action) {
    switch(action.type) {
        case LOGIN_SUCCESS:
            return {...state, }
        default: 
            return state;
    }
}
